const Privacy = ({}) => {
    return (<div>
        <div className="wrapper">
            <div style={{textAlign: 'center'}}>
                <h1>Stack Hack Tutoring Privacy Policy</h1>
                <br />
                <h2>We do not collect your data.</h2>
            </div>
        </div>
    </div>);
};

export default Privacy;
